import "./Footer.css";

function Footer() {
  return (
    <footer className="footer">
      <div className="footer-content">
        <p>تواصل معنا عبر البريد الإلكتروني: support@podtext.com</p>
        <p>© 2025 PodText جميع الحقوق محفوظة</p>
      </div>
    </footer>
  );
}

export default Footer;
